import React from 'react';

import './ConversationItem.css';

const ConversationItem = (props) => {
    const className = "conversation";

    if(props.isActive) {
        className += " active"
    }

    return (
        <div className="conversation active">
            <img src={props.conversation.imageUrl} alt={props.conversation.imageAlt} />
            <div className="title-text">{props.conversation.title}</div>
            <div className="created-date">{props.conversation.cratedAt}</div>
            <div className="conversation-message">
                {props.conversation.latestMessageTest}
            </div>
        </div>
    );
}

export default ConversationItem;

